import React, { Component } from 'react'

export default class ItemsList extends Component {

    constructor(props) {
        super(props);

        this.state = {
          items :[],
          isLoaded: false
        };
      }

    componentDidMount() {

        let config = {
          headers: {
            'Authorization': 'Bearer: 456645412 ' 
          }
        }

        axios.get('http://jsonplaceholder.typicode.com/users', config)
          .then(response => {
            this.setState({
              isLoaded:true,
              items: response.data
            }) 
          })
          .catch(function (error) {
            console.log(error);
          }) 

      }


    render() {
    return (
      <div>
        <ul>
            {items.map(item => (
                <li key={item.id}>{item.name} | {item.email}
                <Link></Link>
                </li>

            ))};

            </ul>
      </div>
    )
  }
}
